def findKthNumber(m, n, k):
    (low, high) = (1, m * n)
    while low <= high:
        mid = (low + high) // 2
        if sum((min(mid // i, n) for i in range(1, m + 1))) < k:
            low = mid + 1
        else:
            high = mid
    return low

